import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

document.body.style.background='data:image/svg+xml;charset=utf-8,<svg xmlns="http://www.w3.org/2000/svg" width="100%" height="100%"><defs><pattern id="paper-texture" patternUnits="userSpaceOnUnit" width="20" height="20"><path d="M0 0 L20 0 L20 20 Z M10 10 L15 15 L5 15 Z M0 10 L10 5 L10 15 Z" fill="#fff" stroke="#ccc" stroke-width="1"/><path d="M5 5 L15 15 Z M10 0 L10 20 Z M0 15 L20 5 Z" fill="#fff" stroke="#ccc" stroke-width="1"/></pattern></defs><rect x="0" y="0" width="100%" height="100%" fill="url(#paper-texture)"/></svg>';

let users = [
  { name: 'moein', age: 20, gen: "mel" },
  { name: 'sadaf', age: 21, gen: "famel" },
  { name: 'sahar', age: 22, gen: "famel" }
]

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <App {...users} />
  </>
);
